//创建外壳
import React,{Component} from "react";
import Header from "./Header";
import List from "./List";
import './App.css'


export default class Todo extends Component {

    state = {content:'我是瓜'}

    render() {
        return(
            <div className="todo-cell">
                <Header />
                <List content={this.state}/>
            </div>
        )
    }
}
